Description:
  type: cexolocstr
  value:
    0: |-
      Selten findet man ihresgleichen so hoch im Norden, und manch einer mag sich über die Herkunft der exotischen Schönheit wundern, die vor ihm steht. Schlank, hochgewachsen, mit sonnengebräunter Haut und nachtschwarzen Haar entspricht sie dem Sinnbild der schönen Calishitin oder auch Mulanerin, sodenn man eine findet sie sich nicht wie üblich den Kopf schert.

      Davon abweichen würden allerdings die Augen, die in strahlendem Himmelsblau zu leuchten scheinen. Ebenso auffallend ist dass selbst bei völliger Windstille stets eine laue Brise durch ihr Haar und ihre meist leichte Kleidung zu flattern scheint.

      Meist ziert ein Lächeln ihre Lippen, und ihre Stimme ist von sanfter, leicht rauchiger Natur, und scheint weniger für scharfe Worte geschaffen als dafür, einen Gesprächspartner in ihren Bann zu ziehen. Sie scheint auch vielerlei Sprachen zu beherrschen, nach einem bestimmten Akzent sucht man hierbei vergeblich.

      Eine arkane Untersuchung ergibt nichts weiter auffälliges.
